    maxCallTimeForUnansweredCallsMinutes: Optional[int] = None

    mediaPolicySelection: Optional[str] = None

    supportedMediaSetName: Optional[str] = None

    useMaxConcurrentRedirectedCalls: Optional[bool] = None

    maxConcurrentRedirectedCalls: Optional[int] = None

    useMaxFindMeFollowMeDepth: Optional[bool] = None

    maxFindMeFollowMeDepth: Optional[int] = None

    maxRedirectionDepth: Optional[int] = None

